import React from 'react';
import styled from 'styled-components';

const TeamPage = () => {
  const departments = [
    { id: 'admin', name: 'Admin', color: '#c9b8a8' },
    { id: 'operations', name: 'Operations', color: '#c9b8a8' },
    { id: 'content', name: 'Content', color: '#c9b8a8' },
    { id: 'hr', name: 'HR', color: '#c9b8a8' },
    { id: 'photography', name: 'Photography', color: '#c9b8a8' },
    { id: 'events', name: 'Events', color: '#c9b8a8' },
    { id: 'media', name: 'Media', color: '#c9b8a8' },
    { id: 'design', name: 'Design', color: '#c9b8a8' },
    { id: 'tech', name: 'Tech', color: '#c9b8a8' }
  ];

  const teamMembers = {
    admin: [
      { id: 'admin1', name: 'Admin 1' },
      { id: 'admin2', name: 'Admin 2' },
      { id: 'admin3', name: 'Admin 3' }
    ],
    operations: [
      { id: 'op1', name: 'Operations 1' },
      { id: 'op2', name: 'Operations 2' },
      { id: 'op3', name: 'Operations 3' },
      { id: 'op4', name: 'Operations 4' }
    ],
    content: [
      { id: 'content1', name: 'Content 1' },
      { id: 'content2', name: 'Content 2' },
      { id: 'content3', name: 'Content 3' }
    ],
    hr: [
      { id: 'hr1', name: 'HR 1' },
      { id: 'hr2', name: 'HR 2' },
      { id: 'hr3', name: 'HR 3' }
    ],
    photography: [
      { id: 'photo1', name: 'Photography 1' },
      { id: 'photo2', name: 'Photography 2' }
    ],
    events: [
      { id: 'event1', name: 'Events 1' },
      { id: 'event2', name: 'Events 2' }
    ],
    media: [
      { id: 'media1', name: 'Media 1' },
      { id: 'media2', name: 'Media 2' },
      { id: 'media3', name: 'Media 3' }
    ],
    design: [
      { id: 'design1', name: 'Design 1' },
      { id: 'design2', name: 'Design 2' },
      { id: 'design3', name: 'Design 3' }
    ],
    tech: [
      { id: 'tech1', name: 'Tech 1' }
    ]
  };

  return (
    <TeamPageContainer>
      <TeamHeader>
        <MeetOurTeam>
          <MeetText>MEET</MeetText>
          <OurText>OUR</OurText>
          <TeamText>TEAM</TeamText>
        </MeetOurTeam>
        <TeamDescription>
          Design together as a team, <br />
          collaborate with intention, <br />
          and manage projects as one.
        </TeamDescription>
      </TeamHeader>

      <DepartmentsSection>
        {departments.map((dept) => (
          <DepartmentButton key={dept.id} color={dept.color}>
            {dept.name}
          </DepartmentButton>
        ))}
      </DepartmentsSection>

      <TeamSections>
        <TeamSection>
          <SectionTitle>Admin</SectionTitle>
          <MembersGrid>
            {teamMembers.admin.map(member => (
              <MemberCard key={member.id}>
                <MemberName>{member.name}</MemberName>
              </MemberCard>
            ))}
          </MembersGrid>
        </TeamSection>

        <TeamSection>
          <SectionTitle>Operations</SectionTitle>
          <MembersGrid>
            {teamMembers.operations.map(member => (
              <MemberCard key={member.id}>
                <MemberName>{member.name}</MemberName>
              </MemberCard>
            ))}
          </MembersGrid>
        </TeamSection>

        <TeamSection>
          <SectionTitle>Content</SectionTitle>
          <MembersGrid>
            {teamMembers.content.map(member => (
              <MemberCard key={member.id}>
                <MemberName>{member.name}</MemberName>
              </MemberCard>
            ))}
          </MembersGrid>
        </TeamSection>

        <TeamSection>
          <SectionTitle>HR</SectionTitle>
          <MembersGrid>
            {teamMembers.hr.map(member => (
              <MemberCard key={member.id}>
                <MemberName>{member.name}</MemberName>
              </MemberCard>
            ))}
          </MembersGrid>
        </TeamSection>

        <TeamSection>
          <SectionTitle>Photography</SectionTitle>
          <MembersGrid>
            {teamMembers.photography.map(member => (
              <MemberCard key={member.id}>
                <MemberName>{member.name}</MemberName>
              </MemberCard>
            ))}
          </MembersGrid>
        </TeamSection>

        <TeamSection>
          <SectionTitle>Events</SectionTitle>
          <MembersGrid>
            {teamMembers.events.map(member => (
              <MemberCard key={member.id}>
                <MemberName>{member.name}</MemberName>
              </MemberCard>
            ))}
          </MembersGrid>
        </TeamSection>

        <TeamSection>
          <SectionTitle>Media</SectionTitle>
          <MembersGrid>
            {teamMembers.media.map(member => (
              <MemberCard key={member.id}>
                <MemberName>{member.name}</MemberName>
              </MemberCard>
            ))}
          </MembersGrid>
        </TeamSection>

        <TeamSection>
          <SectionTitle>Design</SectionTitle>
          <MembersGrid>
            {teamMembers.design.map(member => (
              <MemberCard key={member.id}>
                <MemberName>{member.name}</MemberName>
              </MemberCard>
            ))}
          </MembersGrid>
        </TeamSection>

        <TeamSection>
          <SectionTitle>Tech</SectionTitle>
          <MembersGrid>
            {teamMembers.tech.map(member => (
              <MemberCard key={member.id}>
                <MemberName>{member.name}</MemberName>
              </MemberCard>
            ))}
          </MembersGrid>
        </TeamSection>
      </TeamSections>
    </TeamPageContainer>
  );
};

const TeamPageContainer = styled.main`
  padding: 2rem;
  background-color: #f8e8d8;
  color: #0a3b1e;
`;

const TeamHeader = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  margin-bottom: 2rem;
`;

const MeetOurTeam = styled.div`
  display: flex;
  flex-direction: column;
